// frontend/src/HelloPage.js
import React, { useEffect, useState } from "react";
import axios from "axios";

function HelloPage() {
    const [message, setMessage] = useState("");

    useEffect(() => {
        // Fetch data from the Crow backend
        axios.get("http://localhost:8080/get-text")
            .then((response) => {
                setMessage(response.data.passText);
            })
            .catch((error) => {
                console.error("Error fetching data:", error);
            });
    }, []);

    return (
        <div>
            <h1>{message}</h1>
        </div>
    );
}

export default HelloPage;
